    backgroundColor: "#F3F4F6",
    color: "#000000",
    border: "none",
    borderRadius: "5px",
    fontFamily: "GothamBold",
    fontSize: "14px",
  },
};

const UserDirectionInfo = () => {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col>
          <Button
            // onClick={() => {
