                style={{
                  fontFamily: "GothamBook",
                  fontSize: "12px",
                }}
              >
                Calle Pedro Moreno no.24, Colonia Lindavista
              </p>
            </Badge>
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default UserDirectionInfo;
